import './App.css';
import Login from './Components/LoginPage/Login';
import Home from './Components/MainPage/Home';
import { BrowserRouter, Route, Routes } from 'react-router-dom';

function App() {
  	return (
    	<div className="App">
			<h1>Hello</h1>
			<BrowserRouter>
				<Routes>
          			<Route exact path="/Login">
						<Login/>
          			</Route>
					<Route exact path="/Home">
						<Home/>
          			</Route>
        		</Routes>
      		</BrowserRouter>
    	</div>
  	);
}

export default App;
